  "translationLines": [
    {
      "lineNumber": 227852,
      "originalJapaneseLine": "「皆も最初は戸惑うであろうこと想像に難くない。",
      "translatedEnglishLine": "\"It's not hard to imagine that everyone would be confused at first."
    },
    {
      "lineNumber": 227853,
      "originalJapaneseLine": "　しかし、救世の為には仕方なきこと」",
      "translatedEnglishLine": "However, this is necessary for salvation.\""
    },
    {
      "lineNumber": 227854,
      "originalJapaneseLine": "「いずれ皆も理解しようぞ。",
      "translatedEnglishLine": "\"Eventually, everyone will come to understand."
    },
    {
      "lineNumber": 227855,
      "originalJapaneseLine": "　我が行いの正しさを……」",
      "translatedEnglishLine": "The righteousness of my actions...\""
    },
    {
      "lineNumber": 227856,
      "originalJapaneseLine": "「そ、そんな……」",
      "translatedEnglishLine": "\"Th-that's...\""
    },
    {
      "lineNumber": 227857,
      "originalJapaneseLine": "「はっはっはっ、いずれその暁には、",
      "translatedEnglishLine": "\"Ha ha ha, in due time at that dawn,"
    },
    {
      "lineNumber": 227858,
      "originalJapaneseLine": "　皆も我に、そして何よりも全裸教の理念に",
      "translatedEnglishLine": "everyone will be grateful to me, and above all, to the philosophy of the Church of Nudity,"
    },
    {
      "lineNumber": 227859,
      "originalJapaneseLine": "　感謝し涙を流すことであろう」",
      "translatedEnglishLine": "and will shed tears of gratitude.\""
    },
    {
      "lineNumber": 227860,
      "originalJapaneseLine": "「全てはそれまでの辛抱よ」",
      "translatedEnglishLine": "\"All you need is patience until then.\""
    },
    {
      "lineNumber": 227861,
      "originalJapaneseLine": "「そんなのって……ひどい……」",
      "translatedEnglishLine": "\"That's just... horrible...\""
    },
    {
      "lineNumber": 227862,
      "originalJapaneseLine": "「むう？」",
      "translatedEnglishLine": "\"Hmm?\""
    },
    {
      "lineNumber": 227863,
      "originalJapaneseLine": "「ひっ！」",
      "translatedEnglishLine": "\"Eek!\""
    },
    {
      "lineNumber": 227864,
      "originalJapaneseLine": "全裸の大男にじろりと睨まれ、",
      "translatedEnglishLine": "Glared at coldly by a naked giant man,"
    },
    {
      "lineNumber": 227865,
      "originalJapaneseLine": "スシヌはすぐさま身を縮こまらせた。",
      "translatedEnglishLine": "Sushinu immediately shrank back."
    },
    {
      "lineNumber": 227866,
      "originalJapaneseLine": "「小娘。",
      "translatedEnglishLine": "\"Little girl."
    },
    {
      "lineNumber": 227867,
      "originalJapaneseLine": "　言いたいことがあるのか？」",
      "translatedEnglishLine": "Do you have something to say?\""
    },
    {
      "lineNumber": 227868,
      "originalJapaneseLine": "「あ、あの……あ……」",
      "translatedEnglishLine": "\"Uh, um... ah...\""
    },
    {
      "lineNumber": 227869,
      "originalJapaneseLine": "「な、なんでも、なくて、あの……」",
      "translatedEnglishLine": "\"N-no, it's nothing, um...\""
    },
    {
      "lineNumber": 227870,
      "originalJapaneseLine": "スシヌはあなたの後ろで、",
      "translatedEnglishLine": "Sushinu, behind you,"
    },
    {
      "lineNumber": 227871,
      "originalJapaneseLine": "瞳に涙を浮かべて俯いていた。",
      "translatedEnglishLine": "lowered her gaze with tears welling up in her eyes."
    },
    {
      "lineNumber": 227872,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 227873,
      "originalJapaneseLine": "「あう、＜エール＞ちゃん……！」",
      "translatedEnglishLine": "\"Aah, <Eiru>-chan...!\""
    },
    {
      "lineNumber": 227874,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 227875,
      "originalJapaneseLine": "「っ！」",
      "translatedEnglishLine": "\"Ah!\""
    },
    {
      "lineNumber": 227876,
      "originalJapaneseLine": "「＜エール＞ちゃん……」",
      "translatedEnglishLine": "\"<Eiru>-chan...\""
    },
    {
      "lineNumber": 227877,
      "originalJapaneseLine": "「う、うん！　私、負けないよ！」",
      "translatedEnglishLine": "\"Y-yeah! I won't lose!\""
    },
    {
      "lineNumber": 227878,
      "originalJapaneseLine": "スシヌはハッキリと前を、",
      "translatedEnglishLine": "Sushinu clearly faced forward,"
    },
    {
      "lineNumber": 227879,
      "originalJapaneseLine": "敵を見据えて目に見えぬ杖を構える。",
      "translatedEnglishLine": "glaring at the enemy, she prepared an invisible staff."
    },
    {
      "lineNumber": 227880,
      "originalJapaneseLine": "「や、やめてもらえないというなら……」",
      "translatedEnglishLine": "\"If you won't stop...\""
    },
    {
      "lineNumber": 227881,
      "originalJapaneseLine": "「あ、あ、あ……」",
      "translatedEnglishLine": "\"Ah, ah, ah...\""
    },
    {
      "lineNumber": 227882,
      "originalJapaneseLine": "「あなたはここで倒します！」",
      "translatedEnglishLine": "\"I will defeat you here!\""
    },
    {
      "lineNumber": 227883,
      "originalJapaneseLine": "「ぜ、ゼスの為に！」",
      "translatedEnglishLine": "\"F-for Zeth's sake!\""
    },
    {
      "lineNumber": 227884,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 227885,
      "originalJapaneseLine": "「ぐ、ぐ、ぐぅぅぅぅ！」",
      "translatedEnglishLine": "\"G-g-guhhh!\""
    },
    {
      "lineNumber": 227886,
      "originalJapaneseLine": "「まさかこのような小娘に",
      "translatedEnglishLine": "\"To think that a little girl like this"
    },
    {
      "lineNumber": 227887,
      "originalJapaneseLine": "　武器を向けられる日が来ようとは！」",
      "translatedEnglishLine": "would one day point a weapon at me!\""
    },
    {
      "lineNumber": 227888,
      "originalJapaneseLine": "「何故だ！」",
      "translatedEnglishLine": "\"Why!\""
    },
    {
      "lineNumber": 227889,
      "originalJapaneseLine": "「何故分かろうとせぬ！",
      "translatedEnglishLine": "\"Why won't you try to understand!"
    },
    {
      "lineNumber": 227890,
      "originalJapaneseLine": "　何故全裸が全ての民を救う",
      "translatedEnglishLine": "Why won't you understand that nudity"
    },
    {
      "lineNumber": 227891,
      "originalJapaneseLine": "　救世の手だと理解せぬ！」",
      "translatedEnglishLine": "is the hand of salvation for all people!\""
    },
    {
      "lineNumber": 227892,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 227893,
      "originalJapaneseLine": "「エゴだと！？",
      "translatedEnglishLine": "\"You say it's ego?!"
    },
    {
      "lineNumber": 227894,
      "originalJapaneseLine": "「きゅ、救世を願う我が行いがエゴであるだと！？",
      "translatedEnglishLine": "\"You say my actions wishing for salvation are ego?!"
    },
    {
      "lineNumber": 227895,
      "originalJapaneseLine": "「うっ、くっ……！」",
      "translatedEnglishLine": "\"Ugh, huh...!\""
    },
    {
      "lineNumber": 227896,
      "originalJapaneseLine": "「い、いや、そのようなことは断じてない！」",
      "translatedEnglishLine": "\"N-no, that is absolutely not true!\""
    },
    {
      "lineNumber": 227897,
      "originalJapaneseLine": "「我が願いは救世！",
      "translatedEnglishLine": "\"My wish is salvation!"
    },
    {
      "lineNumber": 227898,
      "originalJapaneseLine": "　我が行いに一点の曇りなし！」",
      "translatedEnglishLine": "There is not a speck of doubt in my actions!\""
    },
    {
      "lineNumber": 227899,
      "originalJapaneseLine": "「人それぞれだと！？",
      "translatedEnglishLine": "\"Is it just different for each person?!"
    },
    {
      "lineNumber": 227900,
      "originalJapaneseLine": "「は、肌を晒すも晒さぬも、",
      "translatedEnglishLine": "\"Whether to expose the skin or not"
    },
    {
      "lineNumber": 227901,
      "originalJapaneseLine": "　個人の自由でありその裁量に任せよと！？",
      "translatedEnglishLine": "is a personal freedom and should be left to individual discretion?!\""
    },
    {
      "lineNumber": 227902,
      "originalJapaneseLine": "「認めぬ！",
      "translatedEnglishLine": "\"I won't accept that!"
    },
    {
      "lineNumber": 227903,
      "originalJapaneseLine": "　断じて認めぬ！」",
      "translatedEnglishLine": "I absolutely won't accept it!\""
    },
    {
      "lineNumber": 227904,
      "originalJapaneseLine": "「それでは人は救われぬ！",
      "translatedEnglishLine": "\"Then people will not be saved!"
    },
    {
      "lineNumber": 227905,
      "originalJapaneseLine": "　人々の魂は永遠に暗中を迷い続ける！」",
      "translatedEnglishLine": "The souls of people will forever wander in darkness!\""
    },
    {
      "lineNumber": 227906,
      "originalJapaneseLine": "「我こそが救世主！",
      "translatedEnglishLine": "\"I am the savior!"
    },
    {
      "lineNumber": 227907,
      "originalJapaneseLine": "　我が行いは神の御手！」",
      "translatedEnglishLine": "My actions are the hand of God!\""
    },
    {
      "lineNumber": 227908,
      "originalJapaneseLine": "「服を脱ぎ武器を取るだと！？」",
      "translatedEnglishLine": "\"You say you will take off your clothes and take up arms?!\""
    },
    {
      "lineNumber": 227909,
      "originalJapaneseLine": "「わ、我が理念に賛同の意を示しながら、",
      "translatedEnglishLine": "\"You say you show agreement with my ideology,"
    },
    {
      "lineNumber": 227910,
      "originalJapaneseLine": "　なおも我に牙を剥くというか！？",
      "translatedEnglishLine": "yet still bare your fangs at me?!"
    },
    {
      "lineNumber": 227911,
      "originalJapaneseLine": "「いや、なんで脱いだ」",
      "translatedEnglishLine": "\"No, why did you take it off?\""
    }
  ]
}

